  let childFilters;
  if (typeof filters === 'function') {
    childFilters = [filters];
  } else if (filters instanceof RegExp) {
    childFilters = [
      value => (
        typeof value === 'object' && value && value.userAgent
          ? filters.test(value.userAgent)
          : filters.test(value)
      ),
    ];
